import React from 'react';

function Sessions({ sessionSelection, toggleSlider }) {
    const sessions = ["Frontend Development", "Backend Development", "FullStack Development"];

    return (
        <div className=' grid m-5 border rounded-xl text-sm '>
            <div className=''>
                {sessions.map((session, index) => (
                    <div>
                        <div
                            className=' py-5 border-y flex justify-between px-5'
                            key={index}
                            onClick={() => sessionSelection(session)}>

                            {session}
                            <button className=' pl-3 border-l-2' onClick={toggleSlider}>View Details</button>

                        </div>
                    </div>
                ))}
            </div>
        </div>
    );
}

export default Sessions;
